import React, { Component } from 'react';
import './FooterSection.css';

class FooterSection extends Component {
	render() {
		return (
			<div className="footer">
				<ul class="icons">
					<li>
						<a
							class="icon alt fa fa-facebook"
							href="https://www.facebook.com/TheFishingClubAtMichiganTech/?fref=ts"
						>
							<span class="label">Facebook</span>
						</a>
					</li>
					<li>
						<a class="icon alt fa fa-envelope" href="kldanko@mtu.edu">
							<span class="label">Email</span>
						</a>
					</li>
					<li>
						<a class="icon alt fa fa-sign-in" href="login.php">
							<span class="label">Login</span>
						</a>
					</li>
				</ul>
				Website by Jake Mager
			</div>
		);
	}
}

export default FooterSection;
